/* eslint-disable react/jsx-filename-extension */
import React from "react";
import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import NavDropdown from "react-bootstrap/NavDropdown";
import mortarboard from "./icon.svg";

function NavMenu() {
  return (
    <Navbar bg="dark" variant="dark" expand="lg" sticky="top">
      <Container>
        <Navbar.Brand href="/Home">
          <img
            alt="mortarboard logo black and white"
            src={mortarboard}
            width="30"
            height="30"
            className="d-inline-block align-top"
          />{" "}
          eduExp
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link href="/Home">Home</Nav.Link>
            <Nav.Link href="/Raghad">Raghad Page</Nav.Link>
            <Nav.Link href="/Russ">Russ Page</Nav.Link>
            <NavDropdown title="Dat page" id="basic-nav-dropdown">
              <NavDropdown.Item href="/Dat">
                Dat Page
              </NavDropdown.Item>
              <NavDropdown.Item href="#action/3.2">
                Placeholder
              </NavDropdown.Item>
              <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
            </NavDropdown>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default NavMenu;
